import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

function Header() {
	return (
		<ComponentsWrapper>
			<div className="MainBar_MainBar">
				<nav className="MainBar_MainBar_nav">
					<NavLogo>
						<button type="button">
							<img
								src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fstatic.wanted.co.kr%2Fimages%2Ficon-menu.png&amp;w=undefined&amp;q=75"
								alt="hamberger menu"
							/>
						</button>
						<Link to="/">
							<i className="icon-logo_new" />
						</Link>
					</NavLogo>
					<MenuClassName>
						<li>
							<Link to="/jobsfeed">채용</Link>
						</li>
						<li>
							<Link to="/events">이벤트</Link>
						</li>
						<li>
							<Link to="/salary">직군별 연봉</Link>
						</li>
						<li>
							<Link to="/cv/list">이력서</Link>
						</li>
						<li>
							<a href="/community">
								커뮤니티
								<em>
									<svg
										xmlns="http://www.w3.org/2000/svg"
										width="18"
										height="11"
										viewBox="0 0 18 11"
									>
										<g
											fill="none"
											fillRule="evenodd"
											fontFamily="AppleSDGothicNeo-SemiBold, Apple SD Gothic Neo"
											fontSize="9"
											fontWeight="500"
										>
											<g fill="#36F">
												<g>
													<g>
														<g>
															<g>
																<g>
																	<g>
																		<text transform="translate(-931.000000, -13.000000) translate(224.000000, 7.000000) translate(210.000000, 6.000000) translate(350.000000, 0.000000) translate(147.000000, 0.000000)">
																			<tspan
																				x="0"
																				y="8"
																			>
																				New
																			</tspan>
																		</text>
																	</g>
																</g>
															</g>
														</g>
													</g>
												</g>
											</g>
										</g>
									</svg>
								</em>
							</a>
						</li>
					</MenuClassName>
					<aside>회원가입</aside>
				</nav>
			</div>
		</ComponentsWrapper>
	);
}

const NavLogo = styled.div`
	display: flex;
	align-items: center;
	justify-content: space-between;
	button {
		margin-top: -2px;
		margin-right: 15px;
		img {
			width: 17px;
			height: 14px;
			object-fit: contain;
		}
	}
	.icon-logo_new::before {
		content: 'Wanted';
		font-family: 'icomoon' !important;
		speak: none;
		font-style: normal;
		font-weight: normal;
		font-variant: normal;
		text-transform: none;
		line-height: 1;
	}
`;

const MenuClassName = styled.ul`
	height: inherit;
	text-align: center;
	margin: 0;
	li {
		height: inherit;
		display: inline-block;
		a {
			position: relative;
			vertical-align: middle;
			font-size: 14px;
			line-height: 20px;
			font-weight: 600;
			padding: 15px;
			display: inline-block;
            em{
                position: absolute;
    top: 10px;
    right: -5px;
    pointer-events: none;
    font-style: normal;
}
            }
		}
		a:after {
			height: 100%;
			content: '';
			display: inline-block;
			vertical-align: middle;
		}
	}
`;

const ComponentsWrapper = styled.div`
	position: fixed;
	padding-right: initial;
	width: 100%;
	position: fixed;
	background-color: #fff;
	box-shadow: 0 1px 0 0 rgb(0 0 0 / 10%);
	z-index: 800;
	border: 1px solid black;

	.MainBar_MainBar {
		margin: 0 auto;
		height: 50px;
		width: 90%;
		position: relative;
		max-width: 1060px;
		.MainBar_MainBar_nav {
			display: flex;
			align-items: center;
			justify-content: space-between;
			flex-direction: row;
			flex-wrap: wrap;
		}
	}
`;

export default Header;
